import CartIcon from '../Cart/CartIcon.js'

const HeaderCartButton = () => {

    return (
        <button>
            <span>
                <CartIcon />
            </span>
            <span>Your Cart</span>
            <span>3</span>
        </button>
    )
}

export default HeaderCartButton
